import React, { Component } from 'react';
import { Link } from "react-router-dom";
import Breadcrumbs from './Breadcrumbs';
import Loading from './Loading';
import '../index.css';

class CategoryOutput extends Component {

    constructor (props){

        super(props);
        this.state = {
            current_page: [],
            next_page: [],
            max_pages: [],
            category_data: [],
            category_events: [],
            events_url: '/wp-json/occasiongenius/v1/flag/' + this.props.slug,
            isLoading: 1,
        }

    }

    componentDidMount() {

        Promise.all([
          fetch('/wp-json/occasiongenius/v1/flag/' + this.props.slug),
        ])
        .then(([res]) => Promise.all([res.json()]))
        .then(([cat_data]) => this.setState({
          category_data: cat_data.data,
          category_events: cat_data.events,
          current_page: cat_data.info.current_page, 
          next_page: cat_data.info.next_page, 
          max_pages: cat_data.info.max_pages, 
          isLoading: 0
        }));

        document.title = "Local Event Categories";

    } 

    fetchData = async (url) => {

        await fetch(url)
          .then((r) => r.json())
          .then((result) => {
            this.setState({
                category_events: result.events,
                isLoading: 0
            });
          })
          .catch((e) => {
            console.log(e);
          });

    };  

    nextPage = () => {

        this.setState({
            current_page: this.state.current_page + 1,
            isLoading: 1
          },
          () => {
            const events_url = this.state.events_url + "?page=" + this.state.current_page;
            this.fetchData(events_url);
            window.scrollTo({
              top: 0,
              behavior: "smooth"
            });
          }
        );

    };

    prevPage = () => {

        this.setState({
            current_page: this.state.current_page - 1,
            isLoading: 1
          },
          () => {
            const events_url = this.state.events_url + "?page=" + this.state.current_page;
            this.fetchData(events_url);
            window.scrollTo({
              top: 0,
              behavior: "smooth"
            });
          }
        );

    };    

    render(){

        const { current_page, next_page, max_pages } = this.state;

        return (
            <>

                <Breadcrumbs parent_title="All Categories" parent_url="/events/categories/" page_name={ this.state.category_data.Output } />

                <div className="flex items-center justify-center bg-white mb-16">                          
                    <div className="grid grid-cols-12 px-18 gap-5">

                        {this.state.isLoading ? (
                            <Loading />
                        ) : (
                            <>
                                <div className="col-span-12">
                                    <div className="flow-root">
                                        <p className="float-left text-gray-800 text-3xl font-semibold mb-0">
                                            { this.state.category_data.Output }
                                        </p>
                                    </div>
                                </div>

                                {this.state.category_events.map((item, index) => (   
                                    <div className="col-span-3 bg-rose-700 rounded-xl h-52 md:h-80 no-underline" key={index}>
                                        <Link to={`/events/details/${ item.slug }`} className="no-underline">
                                            <img src={ item.image_url } alt={ item.name } className="rounded-t-xl max-h-44" />
                                            <p className="text-xl text-gray-50 pt-4 pl-3 no-underline text-ellipsis ... overflow-hidden line-clamp-2 h-20 pb-1 mb-0"> { item.name } </p>
                                            <p className="text-xs md:text-lg font-light text-gray-50 pt-0 pl-3 pb-0 mb-0 no-underline"> 
                                                { item.date_formatted } <br />
                                                { item.venue_city }, { item.venue_state }
                                            </p>
                                            <span className="text-xs md:text-lg font-light decoration-white	underline text-white text-center block mt-1 underline-offset-4">More Info</span>
                                        </Link>
                                    </div>
                                ))}
                            </>
                        )}        
                    </div> 
                </div>

                <nav aria-label="Page navigation">
                    <ul class="inline-flex space-x-2">
                        <li>
                            <button class="flex items-center justify-center w-10 h-10 text-indigo-600 transition-colors duration-150 rounded-full focus:shadow-outline hover:bg-indigo-100">
                                <svg class="w-4 h-4 fill-current" viewBox="0 0 20 20"><path d="M12.707 5.293a1 1 0 010 1.414L9.414 10l3.293 3.293a1 1 0 01-1.414 1.414l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 0z" clip-rule="evenodd" fill-rule="evenodd"></path></svg>
                            </button>
                        </li>

                        <li><button class="w-10 h-10 text-indigo-600 transition-colors duration-150 rounded-full focus:shadow-outline hover:bg-indigo-100">1</button></li>

                        <li><button class="w-10 h-10 text-indigo-600 transition-colors duration-150 rounded-full focus:shadow-outline hover:bg-indigo-100">2</button></li>

                        <li><button class="w-10 h-10 text-white transition-colors duration-150 bg-indigo-600 border border-r-0 border-indigo-600 rounded-full focus:shadow-outline">3</button></li>

                        <li>
                            <button class="flex items-center justify-center w-10 h-10 text-indigo-600 transition-colors duration-150 bg-white rounded-full focus:shadow-outline hover:bg-indigo-100">
                                <svg class="w-4 h-4 fill-current" viewBox="0 0 20 20"><path d="M7.293 14.707a1 1 0 010-1.414L10.586 10 7.293 6.707a1 1 0 011.414-1.414l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414 0z" clip-rule="evenodd" fill-rule="evenodd"></path></svg>
                            </button>
                        </li>
                    </ul>
                </nav>

                {current_page > 1 &&
                                <>
                                    <button onClick={this.prevPage}>Previous Page</button>
                                </>
                            }
                            {next_page < max_pages &&
                                <>
                                  <button onClick={this.nextPage}>Next Page</button>
                                </>                                
                            }

            </>
        )
    }
}

export default CategoryOutput
